package cz.braza.advent;

import java.io.File;
import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Scanner;

public class AoC202308Wasteland {
    public static void main(String[] args) throws Exception {
        String fileName = "/home/jirka/src/java0/aoc23_08.txt";
        Scanner vstup = new Scanner(new File(fileName));
        String instructions = vstup.nextLine();
        vstup.nextLine(); // empty line
        java.util.Map<String, String> left = new HashMap<>();
        java.util.Map<String, String> right = new HashMap<>();
        String startNodes = "";
        String endNodes = "";
        while (vstup.hasNextLine()) {
            String[] data = vstup.nextLine().split(" = ");
            String key = data[0].trim();
            String[] tgts = data[1].split(", ");
            String tLeft = tgts[0].substring(1);
            String tRight = tgts[1].substring(0, 3);
            // System.out.println("DBG From " + key + " you can go left to " + tLeft + " and right to " + tRight);
            if ('A' == key.charAt(2))
                startNodes += key + " ";
            if ('Z' == key.charAt(2))
                endNodes += key + " ";
            left.put(key, tLeft);
            right.put(key, tRight);
        }
        System.out.println("Done parsing input.");
        System.out.println("Part 2 start nodes: " + startNodes);
        System.out.println("Part 2 end nodes: " + endNodes);
        String current = "AAA";
        String[] p2Nodes = startNodes.trim().split(" ");
        String[] p2ZHits = new String[p2Nodes.length];
        int steps = 0;
        long stepsP2 = 0;
        boolean donePart2 = false;
        boolean donePart1 = false;
        boolean printedPart1 = false;
        boolean printedPart2 = false;
        while (!donePart1 || !donePart2) {
            char inst = instructions.charAt(steps % instructions.length());
            char inst2 = instructions.charAt((int)(stepsP2 % instructions.length()));
            if (!donePart1) {
                if (inst == 'L')
                    current = left.get(current);
                else
                    current = right.get(current);
                steps++;
                if ("ZZZ".equals(current))
                    donePart1 = true;
            } else {
                if (!printedPart1) {
                    printedPart1 = true;
                    System.out.println("In the loop, P1: " + steps);
                }

            }
            if (!donePart2) {
                donePart2 = true;
                String tail = "";
                stepsP2++;
                for (int i = 0; i < p2Nodes.length; i++) {
                    if (inst2 == 'L')
                        p2Nodes[i] = left.get(p2Nodes[i]);
                    else
                        p2Nodes[i] = right.get(p2Nodes[i]);
                    if (p2Nodes[i].length() != 3)
                        System.out.println("DBG Bad node " + p2Nodes[i]);
                    tail += p2Nodes[i].charAt(2);
                    if (p2Nodes[i].charAt(2) != 'Z')
                        donePart2 = false;
                    else {
                        p2ZHits[i] += p2Nodes[i] + stepsP2 + "-";
                    }
                }
                // System.out.println(tail);
                if ("ZZZZZZ".equals(tail))
                    donePart2 = true;
                /*
                System.out.print(inst2);
                if (stepsP2 % 66 == 0)
                    System.out.println();
                 */
                if (stepsP2 % 10000000 == 0)
                    for (String line: p2ZHits)
                        System.out.println(line);
                /**
                 * From the above we know the paths actually DO CYCLE, each ghost path visiting the SAME z-node
                 * every given number of steps:
                 * 17621 = 67 * 263
                 * 18673 = 71 * 263
                 * 20777 = 79 * 263
                 * 12361 = 47 * 263
                 * 19199 = 73 * 263
                 * 16043 = 61 * 263
                 * LCM = 61 * 263 * 71 * 47 * 79 * 71 * 67 = 20685524831999
                 *
                 */
                if (stepsP2 % 1000000000 == 0)
                    System.out.println("\nMLD - " + stepsP2 + "\n");
                /*
                if (stepsP2 % 20000000 == 0)
                    System.out.println("M");
                else if (stepsP2 % 1000000 == 0)
                    System.out.print("m");
                else if (stepsP2 % 50000 == 0)
                    System.out.print(".");

                 */
                if (stepsP2 < 0) {
                    System.out.println("Overflow in LONG?!");
                    break;
                }
            } else {
                if (!printedPart2) {
                    printedPart2 = true;
                    System.out.println("P2 found after " + stepsP2 + "\nNodes: ");
                    for (String end: p2Nodes)
                        System.out.print(end + " ");
                    System.out.println();
                }
            }
        }
        System.out.println("Part 1: Found ZZZ after " + steps + " steps.");
        System.out.println("Part 2: Ghost founds all the Z-nodes after " + stepsP2 + " steps.");
        for (String end: p2Nodes)
            System.out.print(end + " ");
    }
}

